import React from 'react';
import { User } from '../App';
import { useState} from "react";
const Signup = () => {
  const [user, setUser] = useState([
    {
    email: "text@test.com",
    password: "text123*"
    }
  ]);

  function onSubmit(fname) {
    console.log("++++++++++++++++++++++++++++++++++++++++");
    console.log(fname.email);
    console.log(fname.password);
    console.log(fname)
    console.log(user)
    if(user.email === fname.email){
      console.log("true");
    }
    else
    {
      console.log("false");
    }
  }

  return (
    <>
      <h1>Please, log in!</h1>

      <label>Email:</label>
      <input
        type="text"
        onChange={(event) => {
          setUser({...user, email: event.target.value});
        }}
      />
      <label>Password:</label>
      <input
        type="password"
        onChange={(event) => {
          setUser({...user, password: event.target.value})
        }}
      />
      {console.log(user)}
      <User.Consumer>
      {

      (fname)=>{
        return <button onClick={() => onSubmit(fname)}>Submit</button>
      }
      }
      </User.Consumer>

    </>
  )
}
export default Signup;
